export default function App() {

  return (
    <BrowserRouter>
      <div className="App">      
        <NavBar/>
        <Routes>
        <Route exact path='/' element={ <ItemListContainer/> } />
        <Route exact path='/categoria/:categoria' element={ <ItemListContainer/> } />
          {/*<ItemDetailContainer/>*/}
        </Routes>
      </div>
    </BrowserRouter>
  );
}
